import React from 'react';
import { IonHeader, IonToolbar, IonTitle, IonContent } from '@ionic/react';

import './index.css';

const scanDevices: React.FC = () => {
  return (
    <IonContent>
      <IonHeader class="main-header">
        <IonToolbar color="dark" class="main-toolbar">
          <IonTitle class="main-toolbar-title" size="large">Looking for devices...</IonTitle>
        </IonToolbar>
      </IonHeader>
    </IonContent>
  );
};

export default scanDevices;
